import React, {Component} from 'react';
import Nav from './Nav';
import Recetas from './Recetas';

class Recetario extends Component {
    render() {
        return (
            <div className="row my-4">
                <Nav />
                <Recetas />
            </div>
        )
    }
}
export default Recetario;
